import ExpenseApp from "./expenseApp";
import Card from "../Card/card";
import "./expenseApp.css";

const ExpenseItem = (expense) => {
  return (
    <Card className="expenses">
      {expense.expenseData.map(
        <ExpenseApp title={expenseData.title} amount={expenseData.amount} />
      )}
      <ExpenseApp
        title={expense.expenseData[0].title}
        amount={expense.expenseData[0].amount}
        date={expense.expenseData[0].date}
      ></ExpenseApp>
      <ExpenseApp
        title={expense.expenseData[1].title}
        amount={expense.expenseData[1].amount}
        date={expense.expenseData[1].date}
      ></ExpenseApp>
      <ExpenseApp
        title={expense.expenseData[2].title}
        amount={expense.expenseData[2].amount}
        date={expense.expenseData[2].date}
      ></ExpenseApp>
      <ExpenseApp
        title={expense.expenseData[3].title}
        amount={expense.expenseData[3].amount}
        date={expense.expenseData[3].date}
      ></ExpenseApp>
    </Card>
  );
};
export default ExpenseItem;
